import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Home from './Home.js';
import Login from './Login.js';

function App(props) {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/signup">
          <Signup />
        </Route>
        <ProtectedRoute path="/home">
          <Home />
        </ProtectedRoute>
        <Route exact path="/">
          <Redirect exact from="/" to="home" />
        </Route>
        <Route path="*">
          <Redirect exact from="/" to="home" />
        </Route>
      </Switch>
    </BrowserRouter>
  );


  const isLoggedIn = props.isLoggedIn;
  if(isLoggedIn) {
    return (
      <div className="App">
        <div className="App-header">
          <strong>ReadingAid</strong>
        </div>
        <Home />
      </div>
    );
  } else {
    return (
      <div className="App">
        <div className="App-header">
          <strong>ReadingAid</strong>
        </div>
        <Login />
      </div>
    );
  }
}

export default App;
